import React from "react";

import './Navbar.css';
import { MdFace } from 'react-icons/md';
const Navbar = () => {
    return (
        <div className="navbar">
            <span className="navbar-display">Musk</span>
            <div className="navbar-heading">MERN Todo Application</div>
        </div>
    );
}

export default Navbar;
